(12, 'Magazines', 20, '', '<p>Tremors were felt in several parts of the national capital on Friday after an earthquake of 6.8 magnitude hit Afghanistan&#39;s Hindukush region.<br />\r\n&quot;An earthquake of 6.8 magnitude in Hindukush; tremors felt in several parts of North India, including Delhi-NCR,&quot; officials said.<br />\r\nPeople in some offices and residential areas felt the shocks and rushed out of the buildings.<br />\r\nThe tremors were felt for several seconds.<br />\r\nMore details are awaited.</p>', '2019-12-11', '2019-12-19 21:04:58', 1, '2019-12-20 19:23:16', 1, NULL, 1),
