(17, 'Breaking News', 17, '', '<p>The format of a&nbsp;<em>special report</em>&nbsp;or&nbsp;<em>breaking news</em>&nbsp;event on television commonly consists of the current non-news programming (or, in some cases, regularly scheduled newscasts) suddenly switching to a reverse countdown, usually from 5 seconds, to allow any&nbsp;<a href=\"https://en.wikipedia.org/wiki/Network_affiliate\" title=\"Network affiliate\">affiliated stations</a>&nbsp;to switch to the network news feed (television stations typically do not provide these countdowns for local coverage, normally leading with a graphic and/or voiceover announcing the cut-in). If a national network newscast is in progress when the breaking news event occurs, the newscast will pause temporarily to allow other network affiliates to join the network news feed. There is then an opening graphic, featuring music (such as&nbsp;<a href=\"https://en.wikipedia.org/wiki/NBC\" title=\"NBC\">NBC</a>&#39;s &quot;<a href=\"https://en.wikipedia.org/wiki/The_Mission_(theme_music)\" title=\"The Mission (theme music)\">The Pulse of Events</a>&quot;, composed by&nbsp;<a href=\"https://en.wikipedia.org/wiki/John_Williams\" title=\"John Williams\">John Williams</a>) which adds an emphasis on the importance of the event. This is usually followed by the introduction of a&nbsp;<a href=\"https://en.wikipedia.org/wiki/News_anchor\" title=\"News anchor\">news anchor</a>, who welcomes the viewer to the broadcast and introduces the story at hand.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Lower_thirds\" title=\"Lower thirds\">Lower thirds</a>&nbsp;and other graphics may also be altered to convey a sense of urgency.</p>\r\n\r\n<p>Once the story is introduced, the network or local station may, if possible, choose to continue to show a live shot of the anchor or may cut away to video or images of the story that is being followed during the broadcast. Additionally, the coverage may be passed to a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reporter\" title=\"Reporter\">reporter</a>&nbsp;at the location of the breaking event, possibly sharing more information about the story as it breaks.</p>\r\n\r\n<p>Depending on the story being followed, the report may last only a few minutes, or continue for multiple hours &ndash; or with the longest uninterrupted news events, four days &ndash; at a time (events in which the latter instances has occurred include the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Assassination_of_John_F._Kennedy\" title=\"Assassination of John F. Kennedy\">assassination of John F. Kennedy</a>&nbsp;and the&nbsp;<a href=\"https://en.wikipedia.org/wiki/September_11_attacks\" title=\"September 11 attacks\">September 11 attacks</a>, which took place between November 22&ndash;26, 1963 and September 11&ndash;15, 2001, respectively). If coverage continues for an extended amount of time, the network may integrate analysis about the story through analysts in-studio, via phone,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Communications_satellite\" title=\"Communications satellite\">satellite</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Broadband\" title=\"Broadband\">broadband</a>&nbsp;(B-GAN) or through other means of communication. Depending on the severity of the event, regular&nbsp;<a href=\"https://en.wikipedia.org/wiki/Television_commercial\" title=\"Television commercial\">commercial advertising</a>&nbsp;may be completely suspended for sustained coverage, and network affiliates will be required to insert their&nbsp;<a href=\"https://en.wikipedia.org/wiki/Station_identification\" title=\"Station identification\">station identification</a>&nbsp;in at the top of the hour overlaid during the report rather than through the usual means of a station imaging promo or program reminder.</p>', '2019-12-11', '2019-12-19 21:09:48', 1, '2019-12-20 19:44:50', 1, NULL, 1),
(18, 'Latest News', 17, '', '<p>Latest News</p>', '2019-12-20', '2019-12-20 18:32:08', 1, NULL, 0, NULL, 1),
(19, 'Latest News', 17, '', '<p>Grindr, the most popular dating app for the LGBTQ community, is generating negative effect on men&#39;s body image, especially when it came to weight, say researchers. Three out of four gay men are reported to have used Grindr, according to a new University of Waterloo study.</p>\r\n\r\n<p>&quot;We were surprised to find that weight stigma is perpetuated by individual users and embedded within the app&#39;s information architecture,&quot; said Eric Filice, a public health doctoral candidate and lead author of the study.</p>\r\n\r\n<p>Since Grindr facilitates anonymity more than other apps (it doesn&#39;t require a name or link to other social media platforms), and because its pre-set body descriptions don&#39;t acknowledge being overweight, most participants in the study perceived being overweight as a stigma.</p>\r\n\r\n<p>&quot;Participants recalled their body weight or shape being scrutinized for allegedly being incompatible with their gender expression or preferred position during intercourse,&quot; said Filice.</p>\r\n\r\n<p>The study also found that apart from weight stigma, body dissatisfaction stemmed from sexual objectification and appearance comparison.</p>\r\n\r\n<p>&quot;It doesn&#39;t help that because Grindr exists to connect users for dating or sex, physical appearance bears greater cultural salience,&quot; Filice added.</p>\r\n\r\n<p>Thirteen participants from several cities in the Greater Toronto Area, as well as surrounding municipalities, took part in the study that appeared in the journal Body Image.</p>', '2019-12-20', '2019-12-20 19:09:05', 1, NULL, 0, NULL, 1),
(20, 'Sports News', 12, '', '<p>KKR breaks the bank for Cummins with ?15.50 crore bid Four of the five-most expensive signing are pace bowlers; Chawla is the priciest Indian star<br />\r\nAs expected, pacers ruled the roost as the eight franchisees splurged a combined sum of ?140.30 crore on 62 players who were sold during the 13th Player auction of the Indian Premier League on Thursday.<br />\r\nBucking the trend of the big-hitters stealing the show at previous auctions, four of the five most expensive signing were pace bowlers.<br />\r\nWhile Australia&rsquo;s Pat Cummins attracted a historic bid of ?15.50 crore from Kolkata Knight Riders (KKR) in a five-way battle &mdash; the highest amount ever paid for an overseas cricketer and the second-highest across IPL auctions &mdash; Chris Morris, the South African pace-bowling all-rounder, joined him in the three-member league of players with nine-digit pay packets after a successful bid of ?10 crore by Royal Challengers Bangalore (RCB).</p>', '2019-12-20', '2019-12-20 19:17:11', 1, NULL, 0, NULL, 1),
(21, 'Times Magazine', 20, '', '<p>Mamata Banerjee After &#39;UN-Monitored Referendum&#39; Remark Draws Flak West Bengal Chief Minister Mamata Banerjee on Friday said she had not called for a UN-monitored referendum over the Citizenship (Amendment) Act, but demanded an opinion poll over the issue.<br />\r\nAddressing a press meet, Banerjee, who is also the TMC supremo, said, &quot;I am proud of my country... I have full faith in my countrymen. What I had said was that a&nbsp;<em>gana</em>&nbsp;vote (opinion poll) be conducted by a panel of impartial experts and members of the National Human Rights Commission. It can be observed by the UN.&quot;<br />\r\nBanerjee had on Thursday dared the Narendra Modi government to go for a UN-monitored referendum on the amended citizenship act and the proposed nationwide NRC . She said the prime minister would have to quit if it fails in the &quot;mass vote&quot;.<br />\r\n&quot;Let there be a nationwide&nbsp;<em>gana</em>&nbsp;vote on CAA and NRC in India. You (Modi government) will not do it.&nbsp;The United Nations will do it, an impartial organisation--let them play a very important role. Make a committee of experts like the UN and (National) Human Rights Commission,&quot;&nbsp;the chief minister said at a public rally on Thursday.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://kwikytechnologies.slack.com/archives/DRD065T62/p1576844554002900\">5:52 PM</a></p>\r\n\r\n<p>continue Magazine: Banerjee&#39;s comments drew sharp reactions from BJP leaders.<br />\r\nUnion Minister Smriti Irani said, &quot;The comment (made by Banerjee) is an insult to Indian Parliament. The legislation has been passed by the Parliament.&quot;<br />\r\nShe added that state governments should take strict actions against people who are helping violent elements.<br />\r\nOn being asked to comment on Smriti Irani&#39;s remark, Banerjee said, &quot;Tell Smriti Irani to send a (police) van from Delhi.&quot;<br />\r\nBanerjee also sought Prime Minister Narendra Modi&#39;s intervention to ensure that the CAA was immediately revoked, contending that it was a matter of the country&#39;s interests.<br />\r\n&quot;It is not about any political victory or defeat. It is matter of our country... Withdraw CAA and NRC,&quot; she said in her appeal to Modi.<br />\r\nHowever, attacking the BJP-led government, she said, &quot;They (the Centre) will make another dictionary, history, define geographies and intellectuals. They will decide what we will eat, our dress code, where we will live, who they will chase out--the list is too long.&quot;</p>', '2019-12-20', '2019-12-20 19:27:08', 1, NULL, 0, NULL, 1),
(22, 'Fashion Magazines', 20, '', '<p>From California&rsquo;s Loyola Marymount University, the candidates sparred over their campaign financing decisions, their past support of America&rsquo;s wars in Iraq and Afghanistan, and how to best combat climate change. The debate stage was the smallest and least diverse yet, but the two women on stage &mdash; Sen. Amy Klobuchar and Sen. Elizabeth Warren&mdash; had some of the most memorable moments: rebuking Indiana Mayor Pete Buttigeig for his relative inexperience compared to the other contenders, and criticizing him for his fundraising methods, respectively.<br />\r\nFormer Vice President Joe Biden also evoked a rare criticism of the Obama Administration, pushing back on the notion that he supported the 2009 decision to send tens of thousands more troops to Afghanistan. &ldquo;I&rsquo;m the guy from the beginning who argued it was a big, big mistake to surge forces to Afghanistan. Period,&rdquo; he said. &ldquo;We should not have done it, and I argued against it constantly.&rdquo;</p>', '2019-12-20', '2019-12-20 19:30:31', 1, NULL, 0, NULL, 1),
(23, 'Politics News', 9, '', '<p>Political journalism aims to provide voters with the information to formulate their own opinion and participate in community, local or national matters that will affect them. According to Edward Morrissey in an opinion article from theweek.com, political journalism frequently includes opinion journalism, as current political events can be biased in their reporting. The information provided includes facts, its perspective is subjective and leans towards one viewpoint.<sup><a href=\"https://en.wikipedia.org/wiki/Political_journalism#cite_note-1\">[1]</a></sup></p>\r\n\r\n<p>Brendan Nyhan and John Sides argue that &quot;Journalists who report on politics are frequently unfamiliar with political science research or question its relevance to their work&quot;.<sup><a href=\"https://en.wikipedia.org/wiki/Political_journalism#cite_note-2\">[2]</a></sup>&nbsp;Journalists covering politics who are unfamiliar with information that would provide context to their stories can enable the story to take a different spin on what is being reported.</p>\r\n\r\n<p>Political journalism is provided through different mediums, in print, broadcast, or online reporting. Digital media use has increased and it provides instant coverage of campaign, politics, event news and an accessible platform for the candidate. Media outlets known for their political journalism like&nbsp;<em><a href=\"https://en.wikipedia.org/wiki/The_New_York_Times\" title=\"The New York Times\">The New York Times</a></em>&nbsp;and the&nbsp;<em><a href=\"https://en.wikipedia.org/wiki/Washington_Post\" title=\"Washington Post\">Washington Post</a></em>, have increased their use of this medium as well. Printed, online, and broadcast political humor presented as entertainment has been used to provide updates on aspects of government status, political news, campaign, and election updates. According to Geoffrey Baym, the information provided may not be considered &quot;fake news&quot; but the lines between entertainment and factual news may seem blurred or biased<sup><a href=\"https://en.wikipedia.org/wiki/Political_journalism#cite_note-3\">[3]</a></sup>&nbsp;while providing political updates. This type of journalism is analyzed, interpreted, and discussed by news media pundits and editorialists. It can lack objectivity which can prevent the accuracy of the presented information. The reporting of news with a bias view point can also take away the audience&#39;s ability to form their own opinion or beliefs of what has been reported. This type of reporting is subjective with a possible social or political purpose.</p>', '2019-12-20', '2019-12-20 19:47:27', 1, NULL, 0, NULL, 1),
(24, 'Political journalism', 9, '', '<p>Civic journalism has began to develop a strong following again after first emerging as a philosophy in the late 1980s and early 1990s. Those who find civic journalism to be a new, progressive, and profound method for the media to engage with the public see it as an opportunity to revitalize democracy as we know it. As technological advances overtake the modern world, it is becoming less common for the general public to buy newspapers or watch TV news to inform themselves on the events in the political sphere. Including this, younger generations, such as Generation X, Generation Y, and even Millennials, are not coming out to the polls due to a variety of reasons. Overall, democracy is beginning to fail as there is a lack of civic engagement and even interference with democratic processes, such as Russia&#39;s involvement with the 2016 United States election, and even electronic voting (e-voting) machines that are being hacked and altering results. All in all, proponents of civic journalism believe that for democracy to regain its traction and glory in the modern world, the media must be more receptive to feedback from the public and take initiative to engage the public as well.</p>\r\n\r\n<p>According to Oxford Research Encyclopedias,<sup><a href=\"https://en.wikipedia.org/wiki/Political_journalism#cite_note-4\">[4]</a></sup>&nbsp;the popularity of political journalism is rising, and the area is becoming one of the more dominant domains of journalism. Political journalism is meant to be more of an overseer of democratic process as they relate to civic engagement rather than a scapegoat for the issues with democracy. Including this, there are four key concepts that political journalism can be boiled down to. These concepts are the framing of politics as a strategic game, interpretive versus straight news, conflict framing and media negativity, and finally, political or partisan bias. In essence, these can be viewed as the four quintessential pillars of civic journalism.</p>', '2019-12-20', '2019-12-20 19:49:14', 1, NULL, 0, NULL, 1),
(25, 'Political News', 9, '', '<p>Nirbhaya&#39;s Mother Breaks Down After Delhi Court Postpones Death Warrant Of Convicts Mother of Nirbhaya, Asha Devi, on Wednesday broke down after a Delhi court postponed the death warrant of four convicts&nbsp;in the gang-rape and murder of her daughter.&nbsp;<br />\r\nSpeaking to reporters, Devi said that wherever she goes, she is told about the rights of the convicts. &quot;But what about our rights?&quot; she asked.<br />\r\nA trial court Wednesday directed Tihar jail authorities to seek response within a week from four death row convicts in the sensational 2012 Nirbhaya gang rape-cum-murder case as to whether they are filing mercy pleas against their executions with the President of India.</p>', '2019-12-20', '2019-12-20 20:00:06', 1, NULL, 0, NULL, 1),
(26, 'Political News', 9, '', '<p>After&nbsp;five-and-a-half years of fighting, Ukraine and Russia have agreed to implement a &ldquo;full and comprehensive&rdquo; ceasefire in eastern Ukraine by the end of 2019. It was reached after Russian President Vladimir Putin and his Ukrainian counterpart Volodomyr Zelensky met in a Paris meeting brokered by Germany and France. Two&nbsp;former Algerian PMs were sentenced long jail terms by a local court on corruption charges. Ahmed Ouyahia was sentenced to 15 years and Abdelmalek Sellal got a 12-year sentence for abusing authority in a car manufacturing embezzlement scandal. Earlier this year, President Abdelaziz Bouteflika was thrown out of power by protestors opposing his re-election bid.</p>\r\n\r\n<p>&quot;It is a big mass movement against an authoritarian regime. All Congress workers in the country will become part of this movement,&quot; he said. Accusing the government of using force and other undemocratic means to suppress the &quot;people&#39;s movement&quot;, Venugopal said the Congress expressed solidarity with the students, youths and other sections who are on the streets fighting for their &quot;democratic rights&quot;.<br />\r\n&quot;Ruthless Britishers were ousted by the people of the country through peaceful agitations led by Indian National Congress during the independence struggle. So if the government thinks that it can suppress the voice of the people using force, that will not succeed&quot;, he said.<br />\r\n<em>Get the best of News18 delivered to your inbox -&nbsp;subscribe to News18 Daybreak. Follow </em><em><a href=\"https://slack-redir.net/link?url=http%3A%2F%2FNews18.com\" rel=\"noopener noreferrer\" tabindex=\"-1\" target=\"_blank\">News18.com</a></em><em> on&nbsp;Twitter,&nbsp;Instagram,&nbsp;Facebook,&nbsp;Telegram,&nbsp;TikTok&nbsp;and on&nbsp;YouTube, and stay in the know with what&#39;s happening in the world around you &ndash; in real time.</em></p>', '2019-12-20', '2019-12-20 20:02:32', 1, NULL, 0, NULL, 1),
(27, 'Political News', 9, '', '<p>An Insult to Parliament, Says Smriti Irani on Mamata Banerjee&rsquo;s Referendum Demand Over Citizenship Law</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Union Minister Smriti Irani on Friday criticised West Bengal Chief Minister Mamata Banerjee over her demand for UN-monitored referendum on amended Citizenship Act and NRC, saying her remark was an insult to the Parliament.<br />\r\nThe Union textile minister is in the city to attend an event at a city hotel. The comment (made by Banerjee) is an insult to Indian Parliament,&quot; Irani told reporters when asked to react on the chief minister&#39;s remark over the citizenship law.<br />\r\nWest Bengal Chief Minister Mamata Banerjee had on Thursday dared the Narendra Modi government at the Centre to go for a UN-monitored referendum on the amended Citizenship Act and the proposed nationwide NRC and said that he will have to quit if it fails &quot;mass vote&quot;.</p>', '2019-12-20', '2019-12-20 20:04:26', 1, NULL, 0, NULL, 1),
(28, 'Political News', 9, '', '<p>Din in MP Assembly as BJP Questions Govt over Farmers&#39; Bonus; Oppn Leaders Stage Walkout</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Madhya Pradesh Legislative Assembly on Thursday witnessed uproarious scenes after the opposition BJP accused the Kamal Nath government of discontinuing the &#39;bonus&#39; given to farmers in the state.<br />\r\nDue to the pandemonium, the Speaker adjourned the House twice before the BJP members staged a walkout over the issue. During the Question Hour, a debate was initiated over the issue of farmers&#39; plight.Besides, for buying the wheat crop from farmers as per the minimum support price (MSP) fixed by the Centre, the cultivators were being given bonus for a decade under the scheme launched by the BJP government, they said.<br />\r\nThe BJP legislators rose to their feet saying there was no budgetary sanction for the bonus.<br />\r\nChief Minister Kamal Nath sought to turn the tables on the BJP by blaming its government at the Centre on the issue.<br />\r\nHe said he had a copy of the letter received from the Centre which stated that if the state government had paid wheat bonus to farmers or plans to pay it in future, procurement from the state would be reduced by 7 lakh metric tonnes.<br />\r\nNath added that he was ready to hold talks with Chouhan over the issue in order to take it up with the Centre.<br />\r\nThe chief minister also alleged that although the state government had suffered heavy losses running into crores of rupees, 28 BJP MPs, out of the 29 in the state, have not done enough to get compensation from the Centre.<br />\r\nHe said &quot;tongue-wagging&quot; and &quot;running a government&quot; were different things altogether. To this, BJP&#39;s Narottam Mishra alleged that the state government was just wagging its tongue and doing nothing.<br />\r\nThis led to noisy scenes in the Assembly, prompting Speaker NP Prajapati to adjourn the House for 10 minutes. When the House re-assembled, allegations flew back and forth between the two sides, following which the House was once against adjourned for five minutes.<br />\r\nAfter the proceedings resumed, the BJP members staged a walkout from the Assembly, denouncing the Congress-led government&#39;s stand over the issue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2019-12-20', '2019-12-20 20:10:29', 1, NULL, 0, NULL, 1),
(29, 'Political News', 9, '', '<p>How I Earned Rs. 11,600,000 to Buy a Car of My Dreams in Just Four Months</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>you have enough money? Do you have everything you&#39;ve been dreaming of? Are you happy with how your life is going? If the answer is &#39;Yes&#39;, then just don&#39;t waste your time and close this page.<br />\r\nThose who answered &#39;No&#39;, go on reading. I&#39;ll tell you how to quit your annoying full time job and start earning Rs. 25,000 or Rs. 40,000 a day in just 2 days, from the comfort of your home.<br />\r\nI succeeded in it, and if you want, you&#39;ll be successful, too! It won&#39;t hurt me if I share this secret with you, while&nbsp;it will help some of&nbsp;you&nbsp;to change your life for good and finally become financially free.<br />\r\nFirst, a couple of words about myself. My name is Shalini Ahuja. I&#39;m 26, I live in Mumbai, and I&#39;m just an ordinary girl from a family, which cannot by any means be called &#39;well-off&#39;. I was born to middle-aged parents. My Mum was a nurse at clinic, while my Dad was a dump truck driver.When I was little, all I remember was that my parents made every effort to buy the cheapest food and clothes possible. If they were lucky enough, they would save up a bit for vacation. We even could tour Europe once in 3 or 4 years.<br />\r\nOnce I graduated from secondary school, I didn&#39;t even think about going to university, as I needed to raise money for my parents (already retired) and myself.<br />\r\nSo I found a job instead, worked as a sales assistant, with a monthly salary around Rs. 8,000. It was 2014, and this was quite a good starting salary for India.<br />\r\nI made enough money for living, but I had a dream, which was to buy a brand new Bentley. I knew it was extemely expensive and I&#39;d have to save up for years. However, this was fine with me. After all, it was a dream, and you just can&#39;t make your dream come true in a day or two. Well, this is what I thought at the time...<br />\r\nI was really depressed at my financial situation then, prices were starting to increase due to inflation and living in India became more difficult. People were upset but I knew I had to carry on working...<br />\r\nHowever, 3 months more passed, and the shop I worked at turned bankrupt, so here I was, with no job or income sources at all, having to live on my parents&#39; retirement benefits.<br />\r\nThese were actually joyless times. I&nbsp;was looking&nbsp;desperately for&nbsp;any possible job opportunity on the Internet, but after nearly two months, there were no results at all.<br />\r\nAnother two weeks passed, and I was about to abandon all hope, when suddenly I came across a web page. This was a&nbsp;story about a guy who had earned Rs. 600,000 on the net, in front of his computer, without even leaving the house he lived in!</p>', '2019-12-20', '2019-12-20 20:12:15', 1, NULL, 0, NULL, 1),
(30, 'Media News', 18, '', '<h1><span style=\"font-size:14px\">UP Police Gives Clean Chit to Scribe Who Shot Salt-Roti Midday Meal Video</span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Uttar Pradesh police cleared the charges against a journalist who was booked for allegedly maligning the image of the state government after he shot a video showing just salt and rotis being served to students of a primary school here.</p>\r\n\r\n<p>However, a representative of the village head, who was also booked under the same charges in connection with the case, has not been cleared, police said.</p>\r\n\r\n<p>The video, shot by journalist Pawan Jaiswal, showing Shiur Primary School under Aharaura Police Station had gone viral on August 22, sparking an opposition backlash against the BJP government in the state.</p>\r\n\r\n<p>The state government had suspended two teachers and a case was registered against Jaiswal, a journalist with a Hindi daily, and the representative of Hinauta village head Rajkumar Pal for allegedly maligning the image of state government.</p>\r\n\r\n<p>The case was registered ten days after the video went viral.</p>\r\n\r\n<p>&ldquo;We have given a clean chit to the journalist as no evidence was found against him during our investigation,&rdquo; superintendent of police Dharamvir Singh told PTI on Thursday.</p>\r\n\r\n<p>Singh said Jaiswal was called by the gram pradhan&rsquo;s representative to shoot the video in the school.</p>', '2019-12-20', '2019-12-20 21:29:33', 1, NULL, 0, NULL, 1),
(31, 'Media News', 18, '', '<h1>Post CAA, BJP-Linked WhatsApp Groups Mount a Campaign to Foment Communalism</h1>\r\n\r\n<p>Last week, when Union home minister Amit Shah defended the Citizenship (Amendment) Bill (now Act) in parliament, he&nbsp;<a href=\"https://timesofindia.indiatimes.com/india/india-can-never-be-muslim-free-amit-shah-taunts-sp-parliamentarian-on-cab/articleshow/72478637.cms\" rel=\"noopener noreferrer\" target=\"_blank\">dismissed</a>&nbsp;concerns that it was targeting India&rsquo;s Muslims and asked the community not to have any fears.</p>\r\n\r\n<p>Instead, he went a step ahead and responded to an opposition leader&rsquo;s comment by saying said, &ldquo;..this country will not be free from Muslims even if you want it to be.&rdquo;</p>\r\n\r\n<p>But away from the glare, inside India&rsquo;s WhatsApp networks, most run directly or indirectly by the Bharatiya Janata Party (BJP) and its affiliates, the messaging is clear and quite the opposite &ndash; that the CAA is a major step towards making India a &lsquo;Hindu Rashtra,&rsquo; and that the Act is a weapon to rid India of its Muslims.</p>\r\n\r\n<p>The investigation found that over the last one week, an organised campaign has been mounted on these WhatsApp groups to stoke Islamophobia and hatred against Muslims and immigrants in the country. In contrast to Shah&rsquo;s public utterances, a systematic flood of messages have sought to advertise the CAA as a tool to &lsquo;kick Muslims out of India&rsquo; and &lsquo;halve India&rsquo;s population, without any effort.&rsquo;</p>\r\n\r\n<p>These groups demonise the Muslim community through unverified statistics and &lsquo;data&rsquo;, call for violence against them and celebrate the prospect of Muslims losing citizenship after the proposed nationwide National Register of Citizens (NRC). The groups are also abuzz with congratulatory messages for Modi, Shah and the BJP, even as they cast the opposition parties as anti-Hindu.</p>', '2019-12-20', '2019-12-20 21:33:16', 1, NULL, 0, NULL, 1),
(32, 'Media News', 18, '', '<h1>CAB: Two Urdu Writers to Return Awards in Protest</h1>\r\n\r\n<p>Senior Urdu journalist and writer Shirin Dalvi has decided to return her state Sahitya Akadami Award in protest against the passing of the contentious Citizenship (Amendment) Bill, 2019, by both houses of the parliament.</p>\r\n\r\n<p>&ldquo;I am saddened and shocked at the news of the passing of the Bill,&rdquo; Dalvi told&nbsp;<em>The Wire</em>.</p>\r\n\r\n<p>A former editor of the Mumbai edition of the&nbsp;<em>Avadhnama</em>, Dalvi further said that she was returning the award to join the voices of her &ldquo;community and people fighting for secularism and democracy.&rdquo;</p>\r\n\r\n<p>According to Dalvi, ever since the Bill was tabled in parliament, it has been a source of anxiety and discomfort amongst Muslims and the feeling has been increasing day by day.</p>\r\n\r\n<p>&ldquo;And that&rsquo;s why Muslims are protesting in different parts of the country. We all have to stand firm to protect our Constitution and the Ganga-Jamuna&nbsp;<em>tehzeeb</em>,&rdquo; she added.</p>\r\n\r\n<p>Meanwhile, Urdu author and translator Yaqoob Yawar has also announced that he will return the Uttar Pradesh State Urdu Academy Award for translation, which was given to him last year.</p>\r\n\r\n<p>&ldquo;I am saddened by the passing of the CAB. Since I am old and can&rsquo;t do much in terms of physical protest, I have decided to return the award in protest,&rdquo; he told&nbsp;<em>The Wire</em>.</p>\r\n\r\n<p>Professor Yawar is former head of department of Urdu of the Banaras Hindu University (BHU) and author and translator of nearly 50 books. Last year he was given the Life Time Achievement Award for Translation, which included the prize of Rs 1 lakh.</p>\r\n\r\n<p>Earlier, on Wednesday, senior IPS officer Abdur Rahman announced his resignation from service as a mark of protest against the bill. &ldquo;This Bill is against the religious pluralism of India. I request all justice loving people to oppose the Bill in a democratic manner. It runs against the very basic feature of the Constitution,&rdquo; he said in his statement released on Twitter</p>', '2019-12-20', '2019-12-20 21:35:16', 1, NULL, 0, NULL, 1),
(33, 'Media News', 18, '', '<h1>Assam Police Beat up Local TV News Channel&#39;s Staff</h1>\r\n\r\n<p>While protests against the&nbsp;Citizenship (Amendment) Bill, 2019 were underway in&nbsp;Guwahati, the Assam police broke into the offices of private TV news channel Prag News and beat up its employees, according to a&nbsp;<a href=\"https://scroll.in/latest/946675/assam-police-beat-up-staffers-of-news-channel-inside-its-guwahati-office\">report in&nbsp;<em>Scroll</em></a>.</p>\r\n\r\n<p>The channel&rsquo;s managing editor Pranay Bordoloi said that the police&nbsp;entered the campus of Prag News in the Ulubari locality around 6 pm and&nbsp;beat up some staffers sitting outside the building. The police then entered the building and&nbsp;beat up other staffers near the reception area, according to&nbsp;Bordoloi.</p>\r\n\r\n<p>&ldquo;It was completely unprovoked and we demand an unconditional apology from Assam police,&rdquo; Bordoloi told&nbsp;<em>Scroll</em>.</p>\r\n\r\n<p>He said that around 45 minutes before the police entered the building, they had&nbsp;dispersed protestors in the locality and asked them to move inside. However there was&nbsp;no reason for them to enter a media office, Bordoloi said.</p>\r\n\r\n<p>Some of the content in regional channels such as Pratidin Time and others such as Dy365, Prag News were closely watched and discussed, an official told&nbsp;<em>ET</em>.</p>\r\n\r\n<p>Thousands of protestors have gathered in Guwahati to protest against the Citizenship Amendment Bill in defiance of the curfew.</p>\r\n\r\n<p>The All Assam Students Union (AASU) has called for a&nbsp;10-hour-hunger strike to protest against the law.</p>\r\n\r\n<p>The suspension of mobile, internet and broadband services was extended for 48 hours on Thursday, beginning at 12 pm, to prevent &ldquo;misuse&rdquo; of social media to disturb peace and tranquility, and to maintain law and order, officials said.</p>\r\n\r\n<p>&nbsp;</p>', '2019-12-20', '2019-12-20 21:49:06', 1, NULL, 0, NULL, 1),
(34, 'Prabhas will be seen in a new look in Jaan', 21, '', '<p>Prabhas will resume shooting for his upcoming project, Jaan from early 2020, say reports. Close to 25% of the film was shot already and the makers are erecting special sets in Hyderabad for the next schedule.<br />\r\n<br />\r\nThe latest we hear is that Prabhas will be seen in a new look in Jaan.<br />\r\n<br />\r\nThe Bahubali star will be sporting slightly thick beard and vintage hairdo. The makers are taking extra care of Prabhas&#39;s looks as he will be seen as a palm reader and the story is set out in 1980&#39;s backdrop.<br />\r\n<br />\r\nThe director Radhakrishna has modified the script in order to suit Prabhas&#39;s taste. The film will go on floors from January if everything goes smoothly.<br />\r\n<br />\r\nPooja Hegde is romancing Prabhas in the big-budget romantic drama.<br />\r\n&nbsp;</p>', '2019-12-21', '2019-12-21 14:48:09', 1, '2019-12-21 15:01:13', 1, '2019-12-21 15:01:36', 1),
