(36, 'Balayya\'s Game Is Over', 19, '', '<p>Nandamuri Balakrishna&#39;s latest film Ruler released yesterday, along with Pratiroju Pandage. Despite publicity and trailers, the movie seems to have not piqued the interest of moviegoers.</p>\r\n\r\n<p>While fans of the star may have been eager to watch the film, one cannot help but point out at the fact that general audiences are least bothered about the films the actor does. This is only proved by a lesser audience for the film when compared to Pratiroju Pandage.</p>\r\n\r\n<p>The film is on its way to becoming a disaster with lesser shows and lesser audience. Balakrishna doesn&#39;t seem to be bothered about it though, given that the actor is about to move on to his next film with director Boyapati Srinu very soon.</p>\r\n\r\n<p>Latest news is that once he wraps up the shoot with Boyapati, he is set to star in the sequel of Aditya 369, and is also set to direct the film himself. There were rumors about the sequel to this film for quite some time now, but the actor seems to be finally doing it now.</p>\r\n\r\n<p>This makes one wonder: will the actor keep making movies whether audiences want to see him or not?</p>', '2019-12-21', '2019-12-21 14:55:20', 1, NULL, 0, NULL, 1),
(37, 'Prabhas, Mahesh Babu in Forbes list', 22, '', '<p>Forbes&#39;s Top 100 Celebrities of India 2019 list is out and the highlights are as followed.<br />\r\n<br />\r\n<strong>Prabhas </strong>and <strong>Mahesh Babu</strong> are the only two Telugu heroes in the list and this year also director Trivikram Srinivas got place in the list.<br />\r\n<br />\r\nPrabhas is at No. 44 by earning 35Cr as remuneration for Saaho and other brand endorsements. Mahesh Babu is at No. 54 and said to have earned same amount as Prabhas. Trivikram Srinivas is at 77 position who has said to be earned 21.50 Cr.<br />\r\n<br />\r\nSachin tendulkar , Virat Kohli and MS Dhoni are in Top 10 and other list maximum dominated by bollywood stars like Akshay Kumar, Ranveer Singh,Alia Bhatt,Shah Rukh Khan and Deepika Padukone.</p>', '2019-12-21', '2019-12-21 14:57:15', 1, '2019-12-21 15:01:02', 1, NULL, 1),
(38, 'Prabhas will be seen in a new look in Jaan', 21, '', '<p>Prabhas will resume shooting for his upcoming project, Jaan from early 2020, say reports. Close to 25% of the film was shot already and the makers are erecting special sets in Hyderabad for the next schedule.<br />\r\n<br />\r\nThe latest we hear is that Prabhas will be seen in a new look in Jaan.<br />\r\n<br />\r\nThe Bahubali star will be sporting slightly thick beard and vintage hairdo. The makers are taking extra care of Prabhas&#39;s looks as he will be seen as a palm reader and the story is set out in 1980&#39;s backdrop.<br />\r\n<br />\r\nThe director Radhakrishna has modified the script in order to suit Prabhas&#39;s taste. The film will go on floors from January if everything goes smoothly.<br />\r\n<br />\r\nPooja Hegde is romancing Prabhas in the big-budget romantic drama.</p>', '2019-12-21', '2019-12-21 15:03:08', 1, NULL, 0, NULL, 1),
(39, 'Pawan Kalyan doesn\'t even have a basic idea of the capital', 24, '', '<p>YSRCP lady firebrand K Roja breathed fire on Janasena chief Pawan Kalyan in her recent media interaction.<br />\r\n<br />\r\n&quot;Pawan Kalyan doesn&#39;t even have a basic idea of the capital. He should either do some research or listen to our speeches in the assembly.&quot;, Roja said.<br />\r\n<br />\r\nThe senior leader further added that Pawan Kalyan is blindly supporting Chandrababu Naidu and criticizing Jagan.<br />\r\n<br />\r\n&quot;Pawan Kalyan changed his word on developing Kurnool as the future capital of Andhra Pradesh and that sums up his political career,&quot; she added.<br />\r\n<br />\r\nWe need to wait and see if Janasena forces will come up with a fitting reply to the YCP MLA.</p>', '2019-12-21', '2019-12-21 15:18:16', 1, NULL, 0, NULL, 1),
(40, 'Jawans will be given 100 days\' leave soon', 25, '', '<p><em><strong>Armed Forces Force </strong></em>(SSB) jawans will be given 100 days&#39; leave soon. The Home Ministry is considering a proposal in this regard. This information was given by Home Minister Amit Shah during the 56th-anniversary parade of SSB in New Delhi. He said that under the leadership of Narendra Modi, in one-and-a-half years, we will bring such a situation that every SSB jawan who protects the border can spend at least 100 days in a year with his family, such arrangements should be done by the Home Ministry.<br />\r\n<br />\r\nAmit Shah also said that the Ministry of Home Affairs has done many facilities for SSB. The retirement age of the personnel has been increased from 57 years to 60 years. Amit Shah said that those who do not want to see peace in India, try to use the borders of Nepal and Bhutan of the country to infiltrate into India. 130 crore people are able to sleep peacefully because the soldiers guarding the border protect the country in a hostile environment.<br />\r\n<br />\r\nHome Minister Amit Shah said that the work that SSB has done in its first incarnation, whenever written in the history of unity and integrity of India, will be engraved in the golden letters in history. When it was established after the Indo-China war, its task was to inculcate the cultural sense of engagement with the border-bound villages and India and to maintain cultural interaction with the entire country by connecting these villages with India.</p>', '2019-12-21', '2019-12-21 15:21:11', 1, NULL, 0, NULL, 1),
(41, 'YSRCP MP Kisses Police Boot', 27, '', '<p>Ex MP J.C. Diwakar Reddy made statements during last year&rsquo;s elections that he would make police lick his boots once TDP is back in power after the elections.</p>\r\n\r\n<p>As a response to this statement, the current MP of Hindupuram, Gorantla Madhav of YSRCP criticized the MP of his offensive remarks. Speaking at his house, the MP said that the police department works for this country, even with their lives at risk, and that they are to be respected.</p>\r\n\r\n<p>In the wake of those statements, Gorantla personally cleaned the boot of a policeman and then kissed it. He also said that ex-CM Chandrababu Naidu was smiling like Duryodhana from Mahabharata, when J.C spoke such offensive statements against the police department.</p>', '2019-12-21', '2019-12-21 15:23:42', 1, NULL, 0, NULL, 1),
(42, 'Disha Patani Gets trolled', 28, '', '<p>Actress Disha Patani gets criticized for posting bold pictures on her Instagram amidst the unrest across India. For the past few days, the protest against the Citizenship Amendment Act and the NRC has made the headlines in every state. While Bollywood personalities like Farhan Akhtar and Zoya Akhtar joined the protest and spoke openly about it on social media, many others like Ranveer Singh, Shah Rukh Khan, Kabir Khan, and others have been called out by the netizens for staying silent over the matter. Actress Disha Patani became their latest target for sharing a picture in a black bikini. Many found the content inappropriate and questioned her on sharing such an image for the CAA protest.</p>', '2019-12-21', '2019-12-21 15:25:19', 1, NULL, 0, NULL, 1),
(43, 'Rajinikanth to team up with Dhanush', 28, '', '<p>Superstar Rajinkanth even at this age is giving run for money to the young actors with his exuberance and acting prowess. With many films in his kitty with Murugadoss&#39; Darbar to name a few, Thalaivar fans are going to have a feats in the coming year. Amidst this, buzz has it that Rajinikanth would team up with Dhanush under his production banner, Wunderbar Studios.<br />\r\n<br />\r\n<br />\r\n<br />\r\nDhanush will produce the film in association with Kalaipuli S Thanu&#39;s V Creations. However, an official announcement is to be made. On the work front, Rajini is also working in &#39;Thalaivar 168&#39; which is produced by Kalanithi Maran under the banner Sun Pictures. The film stars an ensemble cast Khushbu, Meena, Soori, Keerthy Suresh, among others. Keerthy Suresh, who coundn&#39;t contain her happiness, took to Instagram and expressed her happiness. Keerthy wrote, &quot;Extremely happy to announce this magical milestone in my journey. From being awe struck of @rajinikanth sir to sharing screen space with him will be my most cherished memory in my life. Thank you #DirectorSiva sir, it is a pleasure to work with you once again.&quot;</p>', '2019-12-21', '2019-12-21 15:29:46', 1, NULL, 0, NULL, 1),
(44, 'Internet shut down in many areas of Delhi', 25, '', '<p>New Delhi: Due to the protests in many areas of Delhi against the Citizenship Amendment Act, mobile companies have banned the internet in some areas of Delhi. Let us tell you that many organizations had declared protests against Lalit Kila and Mandi House against the Citizenship Amendment Act.<br />\r\n<br />\r\nAfter this, Bharti Airtel has said that as per the instructions of the government in some areas, the internet, SMS and boycott calls have been banned in some areas. Responding to a Twitter user, Vodafone has tweeted that in some areas of Jamia, Shaheen Bagh, Bawana, Seelampur, Jaffarabad, Mandi House, Old Delhi, services have been discontinued, due to which you can use our services at 1 pm Will not be able to use.<br />\r\n<br />\r\nPolice took into custody several protesters protesting against the Citizenship Amendment Act (CAA) on Thursday in the Red Fort area located in the country&#39;s capital. The police also took Swaraj India national president Yogendra Yadav, Jawaharlal Nehru University (JNU) alumnus leader Omar Khalid, and his associates into custody. Khalid along with his colleagues wanted to march from Lal Quila to Shahid Park in ITO.</p>', '2019-12-21', '2019-12-21 15:32:04', 1, NULL, 0, NULL, 1),
(45, 'Latest update on IPL 2020', 29, '', '<p>The auction for the forthcoming season of Indian Premier League is underway and Mumbai Indians have made the first big signing.<br />\r\n<br />\r\nMumbai have signed Australian international Chris Lynn for Rs 2 crores, which happens to be his base price.<br />\r\n<br />\r\nMumbai was the only franchise to bid for Lynn and he will be playing the 4-time champions next year.<br />\r\n<br />\r\nMeanwhile, the next big signing is Robin Uthappa, who was sold for Rs 3 crores to Rajasthan Royals.<br />\r\n<br />\r\nA total of 338 players are in the auction this year, which includes a total of 148 foreign players.</p>', '2019-12-21', '2019-12-21 15:37:37', 1, NULL, 0, NULL, 1),
(46, 'TDP Ex-MLA supports CM Jagan\'s decision', 27, '', '<p>&nbsp;</p>\r\n\r\n<p>It is already known that YS Jagan Mohan Reddy announced that YCP government is planning on developing three capitals in Andhra Pradesh.<br />\r\n<br />\r\nInterestingly enough, Telugu Desam Party Ex-MLA Kondru Murali supported Jagan&#39;s decision.<br />\r\n<br />\r\n&quot;I welcome Jagan&#39;s decision to develop three different capitals in Andhra Pradesh. It is the right move.&quot;, Murali said.<br />\r\n<br />\r\nRumors are rife that murali is dissatisfied with the Telugu Desam Party high command and is looking to join in the ruling party, YSRC. His recent comments are suggesting the same.<br />\r\n<br />\r\nIt needs to be noted that another senior TDP leader Ganta Srinivas also welcomed Jagan&#39;s decision.</p>', '2019-12-21', '2019-12-21 15:37:51', 1, NULL, 0, NULL, 1),
(47, 'Please keep Sana out of all this issues', 29, '', '<p>Former Indian cricket captain and BCCI president Sourav Ganguly stepped in after his daughter Sana post took social media by storm with her Instagram post on CAA. Sharing the excerpt from Khuswant Singh&#39;s &quot;The end of India&quot;, the excerpt read, &quot;Every fascist regime needs communities and groups it can demonize in order to thrive. It starts with one group or two. But it never ends there. A movement built on hate can only sustain itself by continually creating fear and strife.<br />\r\n<br />\r\n<br />\r\n<br />\r\nRealizing the fiasco, Ganguly soon posted, &quot;Please keep Sana out of all this issues .. this post is not true .. she is too young a girl to know about anything in politics.&quot; But by then, her post had caught the attention of netizens in a big way and got widely shared. Sana, however, did not make any personal comment in her Instagram post, but only shared an excerpt.</p>', '2019-12-21', '2019-12-21 15:39:17', 1, NULL, 0, NULL, 1);
