(48, 'Rapes continues in Telangana', 26, '', '<p>As the Disha Case continues, no relief has come to women, as another horrific case surfaces. A 30-year-old man who is on the run has been accused of raping and murdering a 29-year old woman, who was missing since December 5, in Medak. Her decomposed body was found on the outskirts of Ramayampet area. According to the police, the accused had met the victim&#39;s husband in jail and had tried to contact him on the phone after he got out. His call was answered by the woman and he had then befriended her.<br />\r\n<br />\r\nOn the pretext of showing her hidden money and gold, police said the accused took the woman to an isolated area on December 5 and raped her. He killed her soon after and dumped the body at a nearby location, they added. Soon after she went missing, a complaint was registered at a local police station. Her body was found a week later in the outskirts Ramayampet, which is 90 km away from the victim&#39;s native place.<br />\r\n<br />\r\n<br />\r\n<br />\r\nBased on evidence from CCTV footage, police said they were able to nab the accused. Cops said the footage showed the two of them on the bike together on the day of the crime. Days later, the accused was found travelling on the victim&#39;s bike. He was stopped by the cops and the vehicle registration details were cross-checked, the police said. A case has been registered under sections 307 (murder), section 376 (rape) and other sections under the Indian Penal Code. According to the police, the accused already has pending cases of extortion and a case for escaping from legal custody. The accused has been on the &#39;rowdy sheeters&#39; list in a local police station in Dichpally, Nizamabad.</p>', '2019-12-21', '2019-12-21 15:39:40', 1, NULL, 0, NULL, 1),
(49, 'Nirbhaya case: Delhi HC adjourns convict\'s plea claiming he was juvenile', 25, '', '<p>The Delhi High Court on Thursday adjourned till January 24 the petition filed by one of the death-row convicts in the Nirbhaya rape case claiming that he was a juvenile at the time of the offence.<br />\r\n<br />\r\nJustice Suresh Kumar Kait adjourned the matter after convict Pawan Kumar Gupta&#39;s lawyer, advocate A P Singh, sought time to file fresh documents.<br />\r\n<br />\r\nJustice Kait allowed the counsel to take another date in the criminal revision petition filed by Gupta, who claimed his ossification test was not done at that point and he should be given the benefit of that.<br />\r\n<br />\r\nGupta, in his plea, had stated that since he was juvenile in 2012 when the rape was committed, he should be treated under the Juvenile Justice Act. He argued that the claim of juvenility can be raised at any time even after the final disposal of the case.<br />\r\n<br />\r\n&quot;Ossification test of the petitioner was conducted by the investigating officers. The age verification report filed by the investigating officers could not be relied upon. The convict should be treated as a juvenile under the Juvenile Justice Act,&quot; stated the petition.<br />\r\n<br />\r\nThe case pertains to for rape and murder of a 23-year-old paramedical student by six men on a moving bus on the night of December 16, 2012.<br />\r\n<br />\r\nGupta, along with three others - Akshay, Vinay and Mukesh - is facing the gallows in the case. The main accused, Ram Singh, allegedly committed suicide in Tihar Jail during the trial.<br />\r\n<br />\r\nAnother accused was a minor at the time of the commission of the crime and was sent to a reform facility and released after three years.</p>', '2019-12-21', '2019-12-21 15:40:52', 1, NULL, 0, NULL, 1),
(50, 'UN chief about anti CAA protests', 30, '', '<p>United Nations (UN) Secretary-General Antonio Guterres is concerned about the violence and the &quot;alleged use of excessive force&quot; in the protests against the Citizenship Amendment Act (CAA) in India, his spokesperson Stephane Dujarric said on Tuesday. &quot;We very much call for restraint and urge full respect for the rights of freedom of opinion and expression and peaceful assembly,&quot; he said while answering a question about the protests at Jamia Millia Islamia in New Delhi.<br />\r\n<br />\r\nOn the CAA, he said that he would refer to the &quot;very strong words&quot; from Human Rights High Commissioner Michelle Bachelet. Bachelet&#39;s spokesperson Jeremy Laurence said last week in Geneva that the law &quot;would appear to undermine the commitment to equality before the law enshrined in India&#39;s Constitution and the country&#39;s international commitments. He added, &quot;While the goal of protecting persecuted groups is welcome, this should be done through a robust national asylum system that is premised on the principle of equality and non-discrimination, and which applies to all people in need of protection from persecution and other human rights violations, with no distinction as to race, religion, national origin or other prohibited grounds.&quot; Several students were injured in police action during a protest last week by students of Jamia Millia Islamia in New Delhi.<br />\r\n<br />\r\n<br />\r\n<br />\r\nPublic transportation was torched while the police came down heavily on the subsequent protests in the Indian capital. Protests have since spread mainly to campuses across India. However, not all protests are against the exclusion of Muslims from the CAA, which gives expedited citizenship to Hindu, Christian, Parsi, Sikh, Jain and Buddhist refugees from the officially Islamic Afghanistan and Pakistan and Muslim-majority Bangladesh. In Assam, which has witnessed some of the most violent protests that have led to deaths, the protesters are against anyone receiving refuge.</p>', '2019-12-21', '2019-12-21 15:41:33', 1, NULL, 0, NULL, 1),
(51, 'What a great hattrick taken by Kuldeep Yadav', 29, '', '<p>As India bowler Kuldeep Yadav bagged a hat-trick in the second ODI against the West Indies here on Wednesday, becoming the first Indian to take two hat-tricks in international cricket, Twitterati erupted in joy and heaped praise on the Chinaman. Congratulating Kuldeep Yadav, BCCI wrote, &quot;HAT-TRICK for @imkuldeep18! First Indian Bowler to have two ODI hat-tricks!&quot;<br />\r\n<br />\r\nFormer cricketer Irfan Pathan tweetded on @IrfanPathan: &quot;Yo boyyyyyy. Well done on your second hattrick @imkuldeep18. More power to you.&quot; A fan gushed in reply: &quot;But sir your hattrick is best in the world.&quot; One fan tweeted: &quot;Kuldeep became the first Indian to take two hat-tricks in ODIs despite having an ODI career of just 55 matches.&quot; Another fan praised him: &quot;What a bowler&quot; One fan posted a meme of a toddler all excited and wrote: &quot;What a great hattrick taken by Kuldeep Yadav to give best support to Team India proud of you men.&quot;</p>', '2019-12-21', '2019-12-21 15:41:53', 1, NULL, 0, NULL, 1),
(52, '3rd US president to face impeachment', 30, '', '<p>&nbsp;</p>\r\n\r\n<p>US President Donald Trump has been impeached after the Democrat-led US House of Representatives voted in his favour of impeachment over the abuse of power and that he had obstructed Congress. With this Trump has became the third president in the US history to be impeached.<br />\r\n<br />\r\n<br />\r\n<br />\r\nThe Democratic-led House passed the abuse of power article of impeachment on a largely party-line 230-197 vote. The House then proceeded with a vote on the second article of impeachment charging him with obstruction of Congress. The second article was passed by a 229-198 vote. Democrats led Wednesday night&#39;s voting, framed in what many said was their duty to protect the Constitution and uphold the nation&#39;s system of checks and balances. Republicans stood by their party&#39;s leader, who has frequently tested the bounds of civic norms. Trump called the whole affair a &quot;witch hunt,&quot; a &quot;hoax&quot; and a &quot;sham,&quot; and sometimes all three.<br />\r\n<br />\r\nPrior to and amid the House debate before the impeachment votes, Trump issued and retweeted tweets from early Wednesday morning, calling Democrats&quot; impeachment effort &quot;an assault&quot; on the country as well as on the Republican Party.</p>', '2019-12-21', '2019-12-21 15:42:54', 1, NULL, 0, NULL, 1),
(53, 'Balayya\'s Game Is Over', 24, '', '<p>Nandamuri Balakrishna&#39;s latest film Ruler released yesterday, along with Pratiroju Pandage. Despite publicity and trailers, the movie seems to have not piqued the interest of moviegoers.<br />\r\n<br />\r\nWhile fans of the star may have been eager to watch the film, one cannot help but point out at the fact that general audiences are least bothered about the films the actor does. This is only proved by a lesser audience for the film when compared to Pratiroju Pandage.<br />\r\n<br />\r\nThe film is on its way to becoming a disaster with lesser shows and lesser audience. Balakrishna doesn&#39;t seem to be bothered about it though, given that the actor is about to move on to his next film with director Boyapati Srinu very soon.<br />\r\n<br />\r\nLatest news is that once he wraps up the shoot with Boyapati, he is set to star in the sequel of Aditya 369, and is also set to direct the film himself. There were rumors about the sequel to this film for quite some time now, but the actor seems to be finally doing it now.<br />\r\n<br />\r\nThis makes one wonder: will the actor keep making movies whether audiences want to see him or not?</p>', '2019-12-21', '2019-12-21 15:43:47', 1, NULL, 0, NULL, 1),
(54, 'Anisha Ambrose in PSPK film?', 24, '', '<p>&nbsp;</p>\r\n\r\n<p>The makers of Pawan Kalyan&#39;s upcoming film and Bollywood remake &#39;Pink&#39; have been on the lookout for the leading actresses and the Jansena Chief has reportedly suggested the name of Anisha Ambrose for one of the lead roles.<br />\r\n<br />\r\nAccording to sources, Pawan has been grooming Anisha to rope her in his upcoming movie Sardaar. But the actress got engaged recently and is reportedly unsure about taking up the offer. Producer Dil Raju will soon officially announce the entire caste, revealed sources.<br />\r\n<br />\r\nAnisha Ambrose had played key roles in films like Ee Nagaraniki Emaindi, Gopala Gopala and Vunnadhi Okate Zindagi.</p>', '2019-12-21', '2019-12-21 15:45:48', 1, NULL, 0, NULL, 1),
(55, 'Osmania, UoH students protest against CAA', 26, '', '<p>Massive protests against the Citizenship Amendment Act (CAA) rocked the Osmania University and University of Hyderabad on Tuesday as the students took out torch rallies. Hundreds of students carrying torches in their hands came together at Arts College in Osmania University to demand rollback of the CAA and to call for boycott of the proposed National Register of Citizens.<br />\r\n<br />\r\nRaising slogans against Modi government and carrying placards, the protestors marched on the campus. The protest brought together various student organisations and non-governmental groups. The protestors condemned the police brutality on students of Jamia Millia Islamia (JMI) and Aligarh Muslim University (AMU) and demanded stringent action against the police personnel who entered the campuses. The placards carried slogans like &quot;Reject CAA, boycott NRC&quot; and &quot;We want justice&quot; .<br />\r\n<br />\r\n&quot;Mashal juloos&quot; or torch procession was also taken out on the campus of University of Hyderabad with students and teachers coming together to protest. The students of the central university carrying torches marched on the campus, demanding complete rollback of CAA and rejecting an all India NRC. The students also demanded action against the Delhi, Uttar Pradesh, Assam and other northeastern states&quot; police for their barbaric assault in campuses and on the streets. The students claimed that they have been protesting against the act since the introduction of the Bill in Lok Sabha. Since the Jamia incident, they have protested thrice. Various students&quot; organisation from the campus along with the faculties participated in the procession.<br />\r\n<br />\r\n&quot;For the polarisation of Hindu and Muslim, the Prime Minister in an election rally is giving statements like &quot;rioteers can be identified by their dress&quot;, the Home Minister is saying that the people who are protesting belong to some political organisation&hellip;. this agitation is more than that,&quot; said Abhishek Nandan, the students union President. Around 300 students and teachers marched together to show their solidarity with the students of various universities. The students burnt the effigy of Union Home Minister Amit Shah. &quot;The government is failing to control the falling economy, unemployment&hellip; instead our Prime Minister and Home Minister are talking about Hindu Rashtra, they are doing aggressive campaign fighting students and people. They are trying to change the notion of secular republic in our Constitution. This CAA is against the Constitution,&quot; said Abhishek Nandan.</p>', '2019-12-21', '2019-12-21 15:47:13', 1, NULL, 0, NULL, 1);
